DROP TABLE IF EXISTS `normitem`;
CREATE TABLE `normitem` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `name` varchar(255) DEFAULT NULL COMMENT '备选项',
  `score` decimal(10,5) DEFAULT NULL COMMENT '分值',
  `sort_code` int(11) DEFAULT NULL COMMENT '排序码',
  `normtarget_id` bigint(20) DEFAULT NULL COMMENT '指标',
  `status` int(11) DEFAULT NULL COMMENT '是否启用（0：禁用，1：启用）',
  PRIMARY KEY (`id`),
  KEY `normtarget_id` (`normtarget_id`),
  CONSTRAINT `normitem_ibfk_1` FOREIGN KEY (`normtarget_id`) REFERENCES `normtarget` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=253 DEFAULT CHARSET=utf8 COMMENT='指标备选项（oes_normitem）';

